        private void CreateAssignments(string path)
        {
            var reader = new StreamReader(path);
            var teachers = _context.Teachers.Include(t => t.SubjectTeachers).ToList();
            var classes = _context.Classes.Include(c => c.SubjectClasses).AsNoTracking().ToList();
            var subjects = _context.Subjects.AsNoTracking().ToList();
            var assignments = new List<Assignment>();
            var records = new List<AssignmentCSV>();

            using (reader)
            using (var csv = new CsvReader(reader, CultureInfo.InvariantCulture))
            {
                while (csv.Read())
                    records.Add(csv.GetRecord<AssignmentCSV>());
            }

            foreach (var record in records)
            {
                foreach (var @className in record.Class.Split(","))
                {
                    var id = Guid.NewGuid();
                    var teacherId = teachers.First(t => t.ShortName == record.Teacher).Id;
                    var subjectId = subjects.First(s => s.ShortName == record.Subject).Id;
                    var classId = classes.First(c => c.Name == @className).Id;
                    var periodCount = classes
                        .First(c => c.Name == @className)
                        .SubjectClasses
                        .First(sc => sc.SubjectId == subjects.First(s => s.ShortName == record.Subject).Id).PeriodCount;
                    var schoolShift = classes.First(c => c.Name == @className).SchoolShift;
                    assignments.Add(new Assignment()
                    {
                        Id = id,
                        TeacherId = teacherId,
                        SubjectId = subjectId,
                        ClassId = classId,
                        SchoolShift = schoolShift,
                        Semester = 1,
                        StartYear = 2023,
                        EndYear = 2024,
                        PeriodCount = periodCount
                    });
                }
            }

            foreach (var teacher in teachers)
                teacher.PeriodCount = assignments.Where(a => a.TeacherId == teacher.Id).Sum(a => a.PeriodCount);

            _context.AddRange(assignments);
            _context.SaveChanges();
        }

        private void UpdateHomeroomTeacher()
        {
            var classes = _context.Classes.Include(c => c.HomeroomTeacher).ToList();
            foreach (var @class in classes)
                @class.HomeroomTeacher.ClassId = @class.Id;
            _context.SaveChanges();
        }

        private List<string> CheckAssignments(int startYear, int endYear, int semester)
        {
            var assignments = _context.Assignments
                .Where(a => a.StartYear == startYear && a.EndYear == endYear && a.Semester == semester && a.IsDeleted == false)
                .ToList();
            var classes = _context.Classes.Include(c => c.SubjectClasses).ThenInclude(sc => sc.Subject).ToList();
            var result = new List<string>();
            foreach (var @class in classes)
            {
                var errorMessage = $"Lớp {@class.Name}: ";
                var errors = new List<string>();
                foreach (var subjectClass in @class.SubjectClasses)
                {
                    var count = assignments.Count(a => a.SubjectId == subjectClass.SubjectId && a.ClassId == @class.Id);
                    if (count == 0)
                        errors.Add($"{subjectClass.Subject.Name}");
                }
                result.Add(errorMessage += string.Join(", ", errors));
            }

            result.Sort();
            return result;
        }

